const App = () => (
    <AuthProvider>
        <Router>
            <Routes>
                <Route path="/login" component={Login} />
                <Route path="/" component={Login} />
                <Route from="/" to="/rooms" />
            </Routes>
        </Router>
    </AuthProvider>
);

export default App;

